<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Login | GO CLEAN</title>
    <link href="https://fonts.googleapis.com/css2?family=Inter:wght@300;400;500;600&display=swap" rel="stylesheet">
    <style>
        body {
            margin:0;
            font-family:'Inter', sans-serif;
            background:#f8fbff;
            display:flex;
            height:100vh;
        }
       .left {
    flex: 1.2;
    background-image: url('/image/logo1.jpg');
    background-size: cover;
    background-position: center;
    background-repeat: no-repeat;
    color: white;
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;
    padding: 40px;
}
        .right {
            flex:1;
            display:flex;
            justify-content:center;
            align-items:center;
        }
        .card {
            width:80%;
            max-width:380px;
            background:white;
            border-radius:14px;
            padding:28px 30px;
            box-shadow:0 10px 35px rgba(0,0,0,.08);
        }
        input {
            width:100%;
            padding:12px;
            border:1px solid #d7dce3;
            border-radius:8px;
            margin-top:10px;
            font-size:14px;
        }
        button {
            width:100%;
            background:linear-gradient(135deg,#00bd09,#51d6ff);
            border:none;
            padding:12px;
            color:white;
            border-radius:8px;
            font-weight:600;
            font-size:15px;
            margin-top:20px;
            cursor:pointer;
        }
        a{color:#006eff;text-decoration:none;font-size:14px;}
    </style>
</head>
